import React from "react";
import Link from "next/link";
import "./nav.less";
export default function Nav() {
  return (
    <div className="nav">
      导航
      <svg
        class="MuiSvgIcon-root"
        focusable="false"
        viewBox="0 0 24 24"
        aria-hidden="true"
        role="presentation"
      ></svg>
      <Link href="/block">
        <a>跳转到block</a>
      </Link>
    </div>
  );
}
